import React, { useEffect } from "react";
import AOS from "aos";
import "aos/dist/aos.css";
import logo from "../assets/coxdiack-logo.png";
import gallery1 from "../assets/gallery1.jpg";
import gallery2 from "../assets/gallery2.jpg";
import gallery3 from "../assets/gallery3.jpg";
import gallery4 from "../assets/gallery4.jpg";
import videoBg from "../assets/here-bg.mp4";

const Home = () => {
  useEffect(() => {
    AOS.init({ duration: 1000, once: true });
  }, []);

  return (
    <div className="bg-[#0A1837] text-white min-h-screen flex flex-col items-center">
      {/* Hero Section */}
      <section className="relative w-full h-[90vh] flex flex-col justify-center items-center text-center px-6 overflow-hidden">
        <video
          src={videoBg}
          autoPlay
          loop
          muted
          className="absolute top-0 left-0 w-full h-full object-cover opacity-40"
        ></video>

        <div className="relative z-10">
          <img
            src={logo}
            alt="Coxdiack Group Logo"
            className="w-32 md:w-44 mx-auto mb-4"
            data-aos="fade-down"
          />
          <h1
            className="text-3xl md:text-5xl font-bold text-[#00FFA3]"
            data-aos="fade-up"
          >
            Coxdiack Group
          </h1>
          <p
            className="mt-3 text-gray-300 max-w-xl mx-auto"
            data-aos="fade-up"
            data-aos-delay="200"
          >
            Building a creative digital world where innovation meets lifestyle.
          </p>
        </div>
      </section>

      {/* Services / Highlights */}
      <section className="py-20 px-6 w-full max-w-6xl">
        <h2
          className="text-3xl md:text-4xl font-bold text-[#00FFA3] mb-12 text-center"
          data-aos="fade-up"
        >
          Explore Our Creative Spaces
        </h2>

        <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-4 gap-8">
          {[gallery1, gallery2, gallery3, gallery4].map((img, index) => (
            <div
              key={index}
              className="bg-[#11224E] rounded-2xl shadow-lg overflow-hidden border border-[#00FFA3]/20 hover:shadow-[0_0_20px_#00FFA3] transition-transform transform hover:scale-105"
              data-aos="fade-up"
              data-aos-delay={index * 200}
            >
              <img
                src={img}
                alt={`Gallery ${index + 1}`}
                className="w-full h-56 object-cover"
              />
              <div className="p-5">
                <h3 className="text-xl font-semibold text-[#00FFA3] mb-2">
                  Creative Project {index + 1}
                </h3>
                <p className="text-gray-300 text-sm">
                  Explore innovation, design, and lifestyle content crafted by
                  the Coxdiack Group team.
                </p>
              </div>
            </div>
          ))}
        </div>
      </section>

      {/* Footer */}
      <footer className="py-10 border-t border-[#00FFA3]/20 text-center text-gray-400 text-sm w-full">
        © {new Date().getFullYear()} Coxdiack Group — All Rights Reserved.
      </footer>
    </div>
  );
};

export default Home;
